import { Grid, makeStyles } from "@material-ui/core";
import React from "react";
import AQI from "../molecules/aqi/aqi";
import HorizontalLinearStepper from "../molecules/stepper/CustomStepper";

const useStyles = makeStyles((theme) => ({
    leftGrid: {
        width: '890px',
        height: '900px',
    },
    rightGrid:{
        width: '650px',
        height: '900px',
    }
}));

const LocationPrimary = {
    text: "Enter location to know Time Air Quality Index (AQI)",
    imgPath: "yourLocation.png",
    isNumber: false,
    count:"",
    isNumberTag:false,
    numberTag:"",
    textSize:"26px",
    color:"#19293b",
}



export default function Page1(props){
    const classes = useStyles();
    return(
        <div>
            <Grid direction='row'>
                <Grid item className={ classes.leftGrid}>
                    <HorizontalLinearStepper/>
                </Grid>
                <Grid item className={ classes.rightGrid}>
                    <AQI props={ LocationPrimary }/>
                </Grid>
            </Grid>
        </div>
    );
}
